To check more than one thing, you can combine conditions with and or or. if x > 10 and x < 100: print("x is a medium sized number")
elif x < 10 or x > 100: print("x is either small or large")
else: print("x is exactly 10 or 100") They work basically like they do when you use them in English: and is True if both the left and the right side are true, False if either is false or is True if either the left or the right side are true, False if both are false left side right side and True True True True False False False True False False False False left side right side or True True True True False True False True True False False False Note: Python’s or results in True if either the left, the right, or both are True. This is somewhat different from how we speak. Sometimes in English, “or” means one or the other, but not both. That’s sometimes called the “exclusive or” or ‘xor’, but it doesn’t have a Python keyword.

