An infinite loop is a loop that runs forever. For example: x = 4
while x > 0: print("Run on!")
print ("Done!") 4 is always greater than 0, and x never changes, so the loop runs forever. If you accidentally write an infinite loop, you will have to figure out how to stop it. Sometimes you’ll need to force-close the program. If you accidentally run an infinite loop in Replit, press “Stop” at the top of the page, or press Control + C (at the same time) in the console.
